INSERT INTO `qa_answer` VALUES (414,1580109006,0,1,1581929421,10003,1,'鹅颈麦没有声音','检查鹅颈麦是否有打开（灯是否亮）','<span></span><span></span><span>（1）</span><span>&nbsp;</span><span>检查鹅颈麦是否有打开（灯是否亮）</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>检查功放是否将鹅颈麦的声音调到太小</span><br />\r\n<span>（3）</span><span>&nbsp;</span><span>检查鹅颈麦和功放之间的线是否有插好</span><br />\r\n<span>（4）</span><span>&nbsp;</span><span>对鹅颈麦的部件进行跟换，找出损坏部件进行更换</span>\r\n</p>\r\n<span></span><span></span>',4),(420,1580109006,0,1,0,10009,99,'其它问题','请填写报修单','',0),(611,1580109006,0,1,1581930195,10001,6,'电脑无法播放在线视频','<p>卸载原有的flash，下载最新的flash，关闭浏览器后安装</p>','<p>卸载原有的flash，下载最新的flash，关闭浏览器后安装</p>',9),(616,1580109006,0,1,0,10007,99,'其它问题','请填写报修单','',0),(619,1580109006,0,1,0,10008,99,'其它问题','请填写报修单','',0),(621,1580109006,0,1,1581929334,10002,1,'无线麦没有声音','<span>（1）</span><span>&nbsp;</span><span>检查无线麦是否有打开（高频率闪红色和蓝色是在对频率，低频率闪蓝色光则代表已经对频成功）</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>将无线麦靠近讲台下方进行对频</span>','',6),(731,1580109006,0,1,0,10002,2,'无线麦有杂音','请填写报修单','<span>（1）</span><span>&nbsp;</span><span>调节功放的无线麦接口旋钮和麦克风总音量旋钮</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>将无线麦的插线插到功放的其他接口上，或者将有线麦的接口和无线麦的接口进行交换，再进行第一步调音</span>',0),(1114,1580109006,0,1,0,10004,2,'投影仪颜色不对','请填写报修单','<span>（1）</span><span>&nbsp;</span><span>调整讲台下方投影仪的接口，查看是否有插紧</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>如果是投影仪泛黄，可能是投影仪灯泡问题，报告老师进行维修</span>',0),(1213,1580109005,0,1,0,10001,3,'office无法打开或字体缺失','请填写报修单','',0),(1515,1580109006,0,1,0,10003,2,'鹅颈麦有杂音','请填写报修单','<span>（1）</span><span>&nbsp;</span><span>摇晃鹅颈麦的接线，检查是否有杂音（有的话进行更换）</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>摇晃鹅颈麦上半部分的麦把，检查是否有杂音（有的话进行更换）</span><br />\r\n<span>（3）</span><span>&nbsp;</span><span>参考无线麦有杂音解决方案</span>',0),(1516,1580109006,0,1,0,10006,99,'其它问题','请填写报修单','',0),(1533,1580109006,0,1,0,10004,3,'投影仪不清晰','请填写报修单','调整讲台下方投影仪的接口，查看是否有插紧',0),(1666,1580109006,0,1,0,10005,99,'其它问题','请填写报修单','',0),(2021,1580109005,0,1,1581595245,10001,2,'没有网络','（1）	检查网络接口有没有接好','',2),(2272,1580109006,0,1,0,10003,99,'其它问题','请填写报修单','',0),(2497,1580109006,0,1,1581929357,10001,4,'电脑声音太小','调节电脑音量','<span>（1）</span><span>&nbsp;</span><span>调节电脑音量</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>调节功放的 Music vol</span>',1),(4112,1580109006,0,1,0,10002,4,'无线麦无法控制PPT翻页','请填写报修单','检查电脑后面或者前面的u盘接收器是否有闪（如果没有闪，换一下接口插上或者找老师进行更换）',0),(5641,1580109006,0,1,0,10003,3,'鹅颈麦声音太小','请填写报修单','参考无线麦声音太小',0),(6161,1580109006,0,1,0,10001,8,'电脑、显示屏、投影仪正常，不输出画面','请填写报修单','<span>(1) 中控断电15s后开启</span><br /><span>(2) 中控上面台式电脑的接线直接接显示屏，看是否有输出，逐渐排除线路，看哪条线坏了</span>',0),(7545,1580109005,0,1,0,10001,1,'电脑打不开','<span>（1）</span><span>&nbsp;</span><span>检查中控是否有开启</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>检查电脑是否能手动开机（如果可以，则有可能电脑与中控间插线没有插好）</span><br />\r\n<span>（3）</span><span>&nbsp;</span><span>检查电脑电源是否有插好</span><br />\r\n<span>（4）</span><span>&nbsp;</span><span>检查电脑硬件</span><span></span>','',0),(10213,1580109006,0,1,0,10001,5,'U盘插上没有反应','使用讲台下方的USB延长线或者插在讲台下方电脑主机上','',0),(13326,1580109006,0,1,0,10004,1,'投影仪不亮/打不开','<span>（1）</span><span>&nbsp;</span><span>检查中控是否打开</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>使用抽屉里的遥控对投影仪进行开机</span>','<span>（1）</span><span>&nbsp;</span><span><span>检查中控是否打开</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>使用抽屉里的遥控对投影仪进行开机</span></span><span></span><br />\r\n<span>（3）</span><span>&nbsp;</span><span>检查投影仪与中控间的接线是否有接好</span>',0),(16717,1580109006,0,1,1581595827,10001,7,'电脑没有声音','<p>检查电脑是否调成耳机输出</p>','<p>(1)检查电脑是否调成耳机输出</p><p>(2)将电脑后方音频输出线拔出再插紧</p>',5),(17177,1580109006,0,1,0,10004,8,'电脑、显示屏、投影仪正常，不输出画面','请填写报修单','<span>(1) 中控断电15s后开启</span><br /><span>(2) 中控上面台式电脑的接线直接接显示屏，看是否有输出，逐渐排除线路，看哪条线坏了</span>',0),(21754,1580109006,0,1,0,10004,99,'其它问题','请填写报修单','',0),(24146,1580109006,0,1,0,10001,99,'其它问题','请填写报修单','',0),(41461,1580109006,0,1,0,10002,3,'无线麦声音太小','请填写报修单','<span>（1）</span><span>&nbsp;</span><span>调节功放的无线麦接口旋钮和麦克风总音量旋钮</span><br />\r\n<span>（2）</span><span>&nbsp;</span><span>将无线麦的插线插到功放的其他接口上，或者将有线麦的接口和无线麦的接口进行交换，再进行第一步调音</span>',0),(64532,1580109006,0,1,0,10002,99,'其它问题','请填写报修单','',0),(64533,1602497327,0,1,0,10016,11,'fugiat','','',0),(64534,1602498054,0,1,0,10021,11,'11','','',0),(64535,1602498998,0,1,0,10022,11,'11','','',0),(64536,1603111063,0,1,0,10024,1,'test_1','','',0),(64537,1603111665,0,1,0,10024,2,'test_2','','',0),(64538,1603111749,0,1,0,10025,1,'test','','',0),(64539,1603111906,0,1,0,10024,1,'test_3','','',0),(64540,1603112352,0,1,0,10028,1,'1','','',0);
